INSERT INTO `sys_oper_log` VALUES (338, '通知公告', 1, 'com.ruoyi.web.controller.system.SysNoticeController.add()', 'POST', 1, '202409001', '总公司', '/system/notice', '127.0.0.1', '内网IP', '{\"createBy\":\"202409001\",\"noticeContent\":\"<ul><li><span style=\\\"color: var(--md-box-samantha-deep-text-color) ;\\\">高精度回收技术的验证</span>：“星舰” 的超重型助推器是一个长约 70 米、搭载 33 台发动机的巨大圆柱体，要让发射塔的机械臂在半空中精确地 “环抱” 住它并成功回收，技术难度极高。这一成功意味着 SpaceX 在火箭回收的精度控制、姿态调整和机械臂操作等技术方面取得了重大突破，为未来更复杂的太空任务提供了技术基础和经验积累。</li></ul><p><br></p>\",\"noticeTitle\":\"通知\",\"params\":{},\"status\":\"0\"}', NULL, 1, '\r\n### Error updating database.  Cause: java.sql.SQLException: Field \'notice_type\' doesn\'t have a default value\r\n### The error may exist in file [C:\\Users\\13026\\Desktop\\TaskDistributionItem\\twojobboard\\twojobboard-api\\twojobboard-system\\target\\classes\\mapper\\system\\SysNoticeMapper.xml]\r\n### The error may involve com.ruoyi.system.mapper.SysNoticeMapper.insertNotice-Inline\r\n### The error occurred while setting parameters\r\n### SQL: insert into sys_notice (     notice_title,            notice_content,       status,             create_by,      create_time    )values(     ?,            ?,       ?,             ?,      sysdate()   )\r\n### Cause: java.sql.SQLException: Field \'notice_type\' doesn\'t have a default value\n; Field \'notice_type\' doesn\'t have a default value; nested exception is java.sql.SQLException: Field \'notice_type\' doesn\'t have a default value', '2024-10-14 16:46:40', 196);
